void TypedArrayConstructor::construct(TypedArray& typedArray, ArrayBuffer& arrayBuffer, size_t offset, size_t length)
{
    // Check if the input is valid
    if (!arrayBuffer.is_valid()) {
        throw Exception("Invalid array buffer");
